PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE sha1 (sha1sum1 INTEGER NOT NULL, sha1sum2 INTEGER NOT NULL, sha1sum3 INTEGER NOT NULL, dupsha1cnt INTEGER, last_updated REAL, inow REAL DEFAULT (STRFTIME('%Y-%m-%d %H:%M:%f', 'NOW')));
CREATE INDEX sha1_dup    ON sha1 (dupsha1cnt);
CREATE UNIQUE INDEX sha1_sha1sum ON sha1 (sha1sum1,sha1sum2,sha1sum3);
CREATE TRIGGER sha1_lastupdated  AFTER UPDATE OF sha1sum1, sha1sum2, sha1sum3 ON sha1 FOR EACH ROW BEGIN     UPDATE sha1 SET last_updated=DATETIME() WHERE rowid=OLD.rowid ; END;
COMMIT;
